import React, { Component } from 'react'

class Response extends Component {
    printEpisode = () => {

        const episodes = this.props.episodes;

        if(episodes.length === 0) return null;

        console.log(episodes);
    }
    render() {
        return (
            <React.Fragment>
                { this.printEpisode() }
            </React.Fragment>
        );
    }
}

export default Response;
